    for i in range(len(nums)):
        if binary_search(sorted_nums, sorted_nums[i], i + 1, min(i + k, len(nums) - 1)):
            return True
    return False

def binary_search(nums, target, start, end):
    while start <= end:
        mid = (start + end) // 2
        if nums[mid] == target:
            return True
        elif nums[mid] < target:
            start = mid + 1
        else:
            end = mid - -1
    return False
